(10, 'H5P.Chart', 'Chart', 1, 2, 22, 1, 0, 'iframe', 'chart.js, d3.js, pie.js, bar.js', 'chart.css', '', '[\n  {\n    \"name\": \"graphMode\",\n    \"type\": \"select\",\n    \"label\": \"Type of chart\",\n    \"importance\": \"high\",\n    \"options\": [\n      {\n        \"value\": \"pieChart\",\n        \"label\": \"Pie Chart\"\n      },\n      {\n        \"value\": \"barChart\",\n        \"label\": \"Bar Chart\"\n      }\n    ],\n    \"default\": \"pieChart\"\n  },\n  {\n    \"name\": \"listOfTypes\",\n    \"type\": \"list\",\n    \"label\": \"Data elements\",\n    \"importance\": \"high\",\n    \"entity\": \"option\",\n    \"min\": 1,\n    \"defaultNum\": 2,\n    \"field\": {\n      \"name\": \"type\",\n      \"type\": \"group\",\n      \"label\": \"Data element\",\n      \"importance\": \"high\",\n      \"fields\": [\n        {\n          \"name\": \"text\",\n          \"type\": \"text\",\n          \"label\": \"Name\",\n          \"importance\": \"medium\"\n        },\n        {\n          \"name\": \"value\",\n          \"type\": \"number\",\n          \"label\": \"Value\",\n          \"importance\": \"low\",\n          \"default\": 1,\n          \"min\": 0.0001,\n          \"decimals\": 4\n        },\n        {\n          \"name\": \"color\",\n          \"type\": \"text\",\n          \"widget\": \"colorSelector\",\n          \"label\": \"Color\",\n          \"importance\": \"low\",\n          \"default\": \"#000\",\n          \"optional\": true,\n          \"spectrum\": {\n            \"showInput\": true,\n            \"preferredFormat\": \"hex\"\n          }\n        },\n        {\n          \"name\": \"fontColor\",\n          \"type\": \"text\",\n          \"widget\": \"colorSelector\",\n          \"label\": \"Font Color\",\n          \"importance\": \"low\",\n          \"default\": \"#fff\",\n          \"optional\": true,\n          \"spectrum\": {\n            \"showInput\": true,\n            \"preferredFormat\": \"hex\"\n          }\n        }\n      ]\n    }\n  },\n  {\n    \"name\": \"figureDefinition\",\n    \"type\": \"text\",\n    \"label\": \"Text read by readspeakers defining the figure as a chart.\",\n    \"importance\": \"low\",\n    \"default\": \"Chart\",\n    \"common\": true\n  }\n]\n', NULL, 1, 21, NULL, 'https://h5p.org/tutorial-chart', 'https://h5p.org/chart', 1),
(11, 'H5PEditor.ColorSelector', 'H5PEditor.ColorSelector', 1, 3, 1, 0, 0, '', 'scripts/spectrum.js, scripts/color-selector.js', 'styles/spectrum.css, styles/color-selector.css', '', '', NULL, 1, 24, NULL, NULL, NULL, 1),
(12, 'H5P.Collage', 'Collage', 0, 3, 17, 1, 0, '', 'collage.js, template.js, clip.js', 'collage.css', '', '[\n  {\n    \"name\": \"collage\",\n    \"label\": \"Preview\",\n    \"importance\": \"high\",\n    \"type\": \"group\",\n    \"widget\": \"collage\",\n    \"description\": \"You can move(pan) the images around by dragging them. You can also select an image and then use the + or - keys on your keyboard to zoom or simply hold down the Z key while moving your mouse wheel.\",\n    \"fields\": [\n      {\n        \"name\": \"template\",\n        \"label\": \"Layout\",\n        \"importance\": \"high\",\n        \"type\": \"select\",\n        \"options\": [\n          {\n            \"value\": \"1\",\n            \"label\": \"1\"\n          },\n          {\n            \"value\": \"1-1\",\n            \"label\": \"1-1\"\n          },\n          {\n            \"value\": \"2\",\n            \"label\": \"2\"\n          },\n          {\n            \"value\": \"2-1\",\n            \"label\": \"2-1\"\n          },\n          {\n            \"value\": \"1-2\",\n            \"label\": \"1-2\"\n          },\n          {\n            \"value\": \"2-2\",\n            \"label\": \"2-2\"\n          },\n          {\n            \"value\": \"3-1\",\n            \"label\": \"3-1\"\n          },\n          {\n            \"value\": \"1-3\",\n            \"label\": \"1-3\"\n          },\n          {\n            \"value\": \"2-3\",\n            \"label\": \"2-3\"\n          },\n          {\n            \"value\": \"3-2\",\n            \"label\": \"3-2\"\n          },\n          {\n            \"value\": \"3-3\",\n            \"label\": \"3-3\"\n          }\n        ],\n        \"default\": \"2-1\"\n      },\n      {\n        \"name\": \"options\",\n        \"label\": \"Display options\",\n        \"importance\": \"low\",\n        \"type\": \"group\",\n        \"fields\": [\n          {\n            \"name\": \"heightRatio\",\n            \"label\": \"Height\",\n            \"importance\": \"low\",\n            \"type\": \"number\",\n            \"decimals\": 2,\n            \"min\": 0.1,\n            \"max\": 2,\n            \"default\": 0.75\n          },\n          {\n            \"name\": \"spacing\",\n            \"label\": \"Spacing\",\n            \"importance\": \"low\",\n            \"type\": \"number\",\n            \"decimals\": 2,\n            \"min\": 0,\n            \"max\": 2,\n            \"default\": 0.5\n          },\n          {\n            \"name\": \"frame\",\n            \"label\": \"Frame\",\n            \"importance\": \"low\",\n            \"type\": \"boolean\",\n            \"default\": true\n          }\n        ]\n      },\n      {\n        \"name\": \"clips\",\n        \"label\": \"Clips\",\n        \"importance\": \"low\",\n        \"type\": \"list\",\n        \"min\": 1,\n        \"entity\": \"clip\",\n        \"field\": {\n          \"name\": \"clip\",\n          \"label\": \"Clip\",\n          \"importance\": \"low\",\n          \"type\": \"group\",\n          \"fields\": [\n            {\n              \"name\": \"image\",\n              \"type\": \"image\",\n              \"label\": \"Image\",\n              \"importance\": \"low\"\n            },\n            {\n              \"name\": \"offset\",\n              \"label\": \"Offset\",\n              \"importance\": \"low\",\n              \"type\": \"group\",\n              \"fields\": [\n                {\n                  \"name\": \"top\",\n                  \"label\": \"Top\",\n                  \"importance\": \"low\",\n                  \"type\": \"number\",\n                  \"default\": 0\n                },\n                {\n                  \"name\": \"left\",\n                  \"label\": \"Left\",\n                  \"importance\": \"low\",\n                  \"type\": \"number\",\n                  \"default\": 0\n                }\n              ]\n            },\n            {\n              \"name\": \"alt\",\n              \"type\": \"text\",\n              \"label\": \"Alternative text\",\n              \"importance\": \"high\",\n              \"description\": \"Required. If the browser can\'t load the image this text will be displayed instead. Also used by readspeakers.\"\n            },\n            {\n              \"name\": \"title\",\n              \"type\": \"text\",\n              \"label\": \"Hover text\",\n              \"importance\": \"low\",\n              \"description\": \"Optional. This text is displayed when the user hovers his pointing device over the image.\",\n              \"optional\": true\n            },\n            {\n              \"name\": \"scale\",\n              \"label\": \"Scale\",\n              \"importance\": \"low\",\n              \"type\": \"number\",\n              \"decimals\": 2,\n              \"min\": 0.01,\n              \"default\": 1\n            }\n          ]\n        }\n      }\n    ]\n  }\n]\n', NULL, 1, 7, NULL, 'https://h5p.org/tutorial-collage', 'https://h5p.org/collage', 1),
