INSERT INTO `mdl_notifications` (`id`, `useridfrom`, `useridto`, `subject`, `fullmessage`, `fullmessageformat`, `fullmessagehtml`, `smallmessage`, `component`, `eventtype`, `contexturl`, `contexturlname`, `timeread`, `timecreated`, `customdata`) VALUES
(24, 2, 2, 'Moodle updates are available (http://rwtlms.in/acca)', 'Update notifications\n\nThere is a newer Moodle version available!\nMoodle 4.1.10+ (Build: 20240425) Version 2022112810.01 (Stable version)\nMoodle 4.3.4+ (Build: 20240425) Version 2023100904.01 (Stable version)\nMoodle 4.4+ (Build: 20240425) Version 2024042200.01 (Stable version)\nMoodle 4.2.7+ (Build: 20240425) Version 2023042407.01 (Stable version)\n\nSee http://rwtlms.in/acca/admin/index.php for more details\n\nIt is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.\n\nThere is a newer version for some of your plugins available!\nAttendance (mod_attendance) There is a new version 2023020107 available!\nCustom certificate (mod_customcert) There is a new version 2022112807 available!\nH5P (mod_hvp) There is a new version 2023122500 available!\nZoom meeting (mod_zoom) There is a new version 2024041900 available!\nLevel Up XP (block_xp) There is a new version 2024042104 available!\nShortcodes (filter_shortcodes) There is a new version 2023110700 available!\nLevel enrolment (enrol_xp) There is a new version 2023110700 available!\nRestriction by course completion (availability_coursecompleted) There is a new version 2023101400 available!\nLevel availability (availability_xp) There is a new version 2023110700 available!\nUser bulk enrolment (local_bulkenrol) There is a new version 2023010501 available!\nContent security policy (local_csp) There is a new version 2024031401 available!\n\nSee http://rwtlms.in/acca/admin/plugins.php for more details\n\nYour Moodle site http://rwtlms.in/acca is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in Site administration / Server / Update notifications or customise the delivery of this message via your preferences page.\n', 2, '<h1>Update notifications</h1>\n<h2>There is a newer Moodle version available!</h2>\n<ul>\n<li><strong>Moodle 4.1.10+ (Build: 20240425)</strong> Version 2022112810.01 (Stable version)</li>\n<li><strong>Moodle 4.3.4+ (Build: 20240425)</strong> Version 2023100904.01 (Stable version)</li>\n<li><strong>Moodle 4.4+ (Build: 20240425)</strong> Version 2024042200.01 (Stable version)</li>\n<li><strong>Moodle 4.2.7+ (Build: 20240425)</strong> Version 2023042407.01 (Stable version)</li>\n</ul>\n<p>See <a href=\"http://rwtlms.in/acca/admin/index.php\">http://rwtlms.in/acca/admin/index.php</a> for more details</p>\n<p>It is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.</p>\n<h2>There is a newer version for some of your plugins available!</h2>\n<ul>\n<li><strong>Attendance</strong> (mod_attendance) There is a new version 2023020107 available!</li>\n<li><strong>Custom certificate</strong> (mod_customcert) There is a new version 2022112807 available!</li>\n<li><strong>H5P</strong> (mod_hvp) There is a new version 2023122500 available!</li>\n<li><strong>Zoom meeting</strong> (mod_zoom) There is a new version 2024041900 available!</li>\n<li><strong>Level Up XP</strong> (block_xp) There is a new version 2024042104 available!</li>\n<li><strong>Shortcodes</strong> (filter_shortcodes) There is a new version 2023110700 available!</li>\n<li><strong>Level enrolment</strong> (enrol_xp) There is a new version 2023110700 available!</li>\n<li><strong>Restriction by course completion</strong> (availability_coursecompleted) There is a new version 2023101400 available!</li>\n<li><strong>Level availability</strong> (availability_xp) There is a new version 2023110700 available!</li>\n<li><strong>User bulk enrolment</strong> (local_bulkenrol) There is a new version 2023010501 available!</li>\n<li><strong>Content security policy</strong> (local_csp) There is a new version 2024031401 available!</li>\n</ul>\n<p>See <a href=\"http://rwtlms.in/acca/admin/plugins.php\">http://rwtlms.in/