(1, 0, 'true/false', '<p dir=\"ltr\" style=\"text-align: left;\">As \"argument\" is defined in the text, every argument has exactly one conclusion?<br></p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240111062537+ZU19YL', 1704954337, 1704954337, 2, 2),
(2, 0, 'true/false', '<p dir=\"ltr\" style=\"text-align: left;\">As \"argument\" is defined in the text, some arguments may have no premises at all.<br></p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240111062601+wH5s2Y', 1704954361, 1704954361, 2, 2),
(3, 0, 't/f', '<p dir=\"ltr\" style=\"text-align: left;\">According to the text, Aristotle defined truth as the correspondence of a statement or proposition with reality.<br></p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240111062629+dzP2HL', 1704954389, 1704954389, 2, 2),
(4, 0, 't/f', '<p dir=\"ltr\" style=\"text-align: left;\">A conclusion indicator word is used to flag the presence of a conclusion.<br></p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240111062653+pBB4qH', 1704954413, 1704954413, 2, 2),
(5, 0, 't/f', '<p dir=\"ltr\" style=\"text-align: left;\">If no premise or conclusion indicator word is present, then no argument is present.<br></p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240111062719+zQIlLd', 1704954439, 1704954439, 2, 2),
(6, 0, 't/f', '<p dir=\"ltr\" style=\"text-align: left;\">An enthymeme is an argument that is missing a premise or a conclusion or both.<br></p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240111062750+5kHraH', 1704954470, 1704954470, 2, 2),
(7, 0, 'test', '<p dir=\"ltr\" style=\"text-align: left;\">what is?</p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240405092731+bpno44', 1712309251, 1712309251, 2, 2),
(8, 0, 'Q1', '<p dir=\"ltr\" style=\"text-align: left;\">checking?</p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240514045736+yDnwS0', 1715662656, 1715662656, 2, 2),
(9, 0, 'q1', '<p dir=\"ltr\" style=\"text-align: left;\">what is test?</p>', 1, '', 1, 1.0000000, 1.0000000, 'truefalse', 1, 'rwtlms.in+240610065637+nImR8l', 1718002597, 1718002597, 2, 2),
